package main

import (
	"bytes"
	"crypto/md5"
	"encoding/base64"
	"encoding/hex"
	"flag"
	"fmt"
	"image"
	"image/draw"
	_ "image/jpeg"
	"image/png"
	"log"
	"net"
	"time"

	"github.com/nfnt/resize"
	"github.com/runningwild/flow/sample/processor"
	"github.com/runningwild/flow/sample/storage"
	"golang.org/x/net/context"
	"google.golang.org/grpc"
)

var (
	port      = flag.Int("port", 23423, "Port to serve on.")
	storeAddr = flag.String("store-addr", "localhost:12312", "Storage server addr.")
	smiley    image.Image
)

func main() {
	log.SetFlags(log.Lshortfile | log.Ltime)
	flag.Parse()

	smileyData, err := base64.StdEncoding.DecodeString(smileyStr)
	if err != nil {
		log.Fatalf("Unable to decode smiley: %v", err)
	}
	smiley, _, err = image.Decode(bytes.NewBuffer(smileyData))
	if err != nil {
		log.Fatalf("Unable to decode smiley: %v", err)
	}

	conn, err := grpc.Dial(*storeAddr, grpc.WithInsecure())
	if err != nil {
		log.Fatalf("Unable to dial server: %v", err)
	}
	client := storage.NewKeyValClient(conn)
	grpcServer := grpc.NewServer()
	s := &server{
		client: client,
	}
	processor.RegisterProcessServer(grpcServer, s)
	laddr := fmt.Sprintf(":%d", *port)
	listener, err := net.Listen("tcp", laddr)
	if err != nil {
		log.Fatalf("unable to listen on %v: %v", laddr, err)
	}
	log.Fatalf("server terminated: %v", grpcServer.Serve(listener))

}

type server struct {
	client storage.KeyValClient
}

func getTime() string {
	return time.Now().Format("2006-01-02 15:04:05")
}

func (s *server) Process(ctx context.Context, req *processor.ProcessRequest) (*processor.ProcessReply, error) {
	im, _, err := image.Decode(bytes.NewBufferString(req.Image))
	if err != nil {
		return nil, fmt.Errorf("unable to decode image: %v", err)
	}
	sum := md5.Sum([]byte(req.Image))
	id := hex.EncodeToString(sum[:])
	now := getTime()

	// Put the image itself
	if _, err := s.client.Put(ctx, &storage.PutRequest{Element: &storage.Element{Key: id, Val: req.Image}}); err != nil {
		return nil, err
	}

	// Put the job
	task := "task-" + now
	if _, err := s.client.Put(ctx, &storage.PutRequest{Element: &storage.Element{Key: task, Val: fmt.Sprintf("%s.%s", id, now)}}); err != nil {
		return nil, err
	}

	go s.doJob(id, task, im)

	return &processor.ProcessReply{Id: id}, nil
}

func (s *server) doJob(id, task string, im image.Image) {
	time.Sleep(10 * time.Second)
	buf := bytes.NewBuffer(nil)

	rs := resize.Resize(uint(im.Bounds().Dx()), uint(im.Bounds().Dy()), smiley, resize.Lanczos3)
	target := image.NewRGBA(im.Bounds())
	draw.Draw(target, target.Bounds(), im, image.Point{}, draw.Over)
	draw.Draw(target, target.Bounds(), rs, image.Point{}, draw.Over)

	log.Printf("Encoding image...")
	if err := png.Encode(buf, target); err != nil {
		log.Fatalf("Failed to encode image: %v", err)
		return
	}
	log.Printf("Image encoded, %d bytes.", buf.Len())
	if _, err := s.client.Put(context.Background(), &storage.PutRequest{Element: &storage.Element{Key: id + "-done", Val: string(buf.Bytes())}}); err != nil {
		log.Fatalf("Failed to save result: %v", err)
	}

	if _, err := s.client.Put(context.Background(), &storage.PutRequest{Element: &storage.Element{Key: task}}); err != nil {
		log.Fatalf("Failed to complete task: %v", err)
	}
}

